import React, { Component } from 'react';


class Navigation extends Component{
    render() {
  return (
    <Headroom className='header'>

      <aside className='logo'>Portfolio</aside>

      <aside className='navBar'>
        <nav>
          <ul>
            <li>About</li>
            <li>Resume</li>
            <li>Projects</li>
            <li>Contact</li>
          </ul>
        </nav>
      </aside>

      </Headroom>
    );
  }
}

export default Navigation;
